command:example.dev:code:
PS C:> $template = Get-CsTeamTemplate -OdataId '/api/teamtemplates/v1.0/com.microsoft.teams.template.AdoptOffice365/Public/en-US' PS C:> $template | Format-List # show the output object as it would be accessed
PS C:> $template.Category = $null # unset category to copy from public template PS C:> $template.DisplayName = 'New Template from object' PS C:> $template.Channel[1].DisplayName += ' modified' ## add a new channel to the channel list PS C:> $template.Channel += ` @{ ` displayName="test"; ` id="b82b7d0a-6bc9-4fd8-bf09-d432e4ea0475"; ` isFavoriteByDefault=$false; ` }
PS C:> New-CsTeamTemplate -Locale en-US -Body $template
